description:
For Women&#8230;

	This boat neck tee with 3/4 sleeves features a barn owl design laid over a circle swan motif that is also printed on the back of the tee in a subtle green on green. The 3 stripes on his fur indicates that he is a Sargent and this one looks good on everyone. If you&#8217;re rocking the 80s look pull this one off your shoulders and tie up the back for a completely different look.

	100% Baby Rib cotton, combed for softness and comfort. 3/4 sleeves. Durable double-stitched bottom hem, sleeve and neck binding.
